replies.txt_content:
如果是1.7，用矿车
如果是1.8以上可以用盔甲架
但是你没说版本，默认用1.11.2以上方式回答了

利用盔甲架的pose和rotation旋转头部及其所带的方块
summon armor_stand ~ ~ ~ {ArmorItems:[{},{},{},{id:"minecraft:diamond_block",Count:1b}],NoGravity:1b,Invisible:1,Tags:["circle"],Pose:{Head:[0.0f,0.0f,0.0f]}}复制代码
生成一个头部无旋转的盔甲架
summon armor_stand ~ ~ ~ {ArmorItems:[{},{},{},{id:"minecraft:diamond_block",Count:1b}],NoGravity:1b,Invisible:1,Tags:["circle"],Pose:{Head:[0.0f,1.0f,0.0f]}}复制代码
沿y轴旋转了1°的盔甲架
这样穷举365次，就是一个圆了
Rotation:[1.0f,0.0f]是盔甲架整个转1°，上面只是头转1°
但是盔甲架是隐形的，所以看不出什么区别
我就用Pose的方式穷举了
